'Message-ID: <26065155.5051376688971217.JavaMail.b2bdev@dwm2va-vm.newcorp.com>\nMIME-Version: 1.0\nContent-Type: multipart/related;\n	boundary="----=_Part_286_17364726.1376688971215"\n\n------=_Part_286_17364726.1376688971215\nContent-Type: text/html;charset=UTF8\nContent-Transfer-Encoding: quoted-printable\n\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.=\nw3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\n<html xmlns=3D"http://www.w3.org/1999/xhtml">\n<head>\n<meta http-equiv=3D"Content-Type" content=3D"text/html; charset=3DUTF-8" />\n<title>Walmart</title>\n<style>\nhtml {\n=09-webkit-text-size-adjust: none; /* Prevent font scaling in landscape */\n}\n</style>\n</head>\n\n<body style=3D"background: #EEEEEE; text-align: center; margin: 0; padding:=\n 0;">\n<table width=3D"620" border=3D"0" cellspacing=3D"0" cellpadding=3D"0" style=\n=3D"margin: 0 auto;">\n  <tr>\n    <td width=3D"10">&nbsp;</td>\n    <td colspan=3D"3" align=3D"left" height=3D"85" valign=3D"middle" bgcolo=\nr=3D"#FFFFFF" style=3D"border-bottom: 1px solid #cccccc;"><table border=3D"=\n0" cellspacing=3D"0" cellpadding=3D"0">\n        <tr>\n          <td width=3D"22"></td>\n          <td><img src=3D"cid:walmar0.png@13766889711290" width=3D"141"  al=\nt=3D"Walmart" /></td>\n        </tr>\n      </table></td>\n    <td width=3D"10">&nbsp;</td>\n  </tr>\n  <tr>\n    <td rowspan=3D"3">&nbsp;</td>\n    <td rowspan=3D"3" valign=3D"top" bgcolor=3D"#FFFFFF">&nbsp;</td>\n    <td  align=3D"left" valign=3D"top" bgcolor=3D"#FFFFFF" style=3D"font-fa=\nmily:  Arial, Helvetica, sans-serif; font-size: 12px; color: #666666;"><p>&=\nnbsp;</p>\n    <p>\n    %DATE%\n    <br />\n<strong>This is not a bill</strong>\n<br /><br />\n%FULL_NAME%<br />\n%BIZ_NAME%<br />\n%CUST_ADDR1%<br />\n%CUST_ADDR2%<br />\n%CUST_CITY%, %CUST_STATE% %CUST_ZIP%-%CUST_ZIP_4%<br /><br />\n    </p>\n      <p><strong style=3D"font-size: 14px; color: #155fa8;">Dear %FULL_NAME=\n%,</strong><br />\n        <br />\n      Thank you for selecting an electronic check as your preferred payment=\n option for your recent wireless phone insurance transaction. This notice i=\ns being sent by %COMPANY_SENT_NAME%, your %PLAN_NAME% administrator, and se=\nrves as a confirmation that you have authorized %COMPANY_SENT_NAME% to init=\niate a debit to your account via an electronic funds transfer or check draf=\nt for payment of your service fee. This also confirms that if your payment =\nis returned unpaid, you have authorized the collection of your payment and =\nthe returned check fee.*\n<br /><br />\nThe following information pertains to the payment:\n<br /><br />\nDebit Date on or after: %DRAFT_DT%<br />\nAmount: %CURRENCY_TYPE% %DRAFT_AMT%<br />\nPayer''s Name: %PAYER_NM%<br />\nDate of Authorization: %AUTH_DATE%<br />\nReference Number: %REF_NUM%\n<br /><br />\nIf any of the foregoing information is incorrect, please call a customer se=\nrvice representative at %CSR_NUM%.\n<br /><br />\nAGAIN, THIS IS NOT A BILL SO PLEASE DO NOT SUBMIT A PAYMENT. This letter si=\nmply serves as notification that the electronic debit described above has b=\neen initiated pursuant to your verbal authorization.\n<br /><br />\nThank you again for selecting an electronic check as your preferred payment=\n option.\n\n     </p></td>\n    <td rowspan=3D"3" valign=3D"top" bgcolor=3D"#FFFFFF"><img src=3D"cid:50=\npx-space1.png@13766889711291" width=3D"50" height=3D"1" /></td>\n    <td rowspan=3D"3">&nbsp;</td>\n  </tr>\n  <tr>\n    <td  align=3D"left" valign=3D"top" bgcolor=3D"#FFFFFF" style=3D"font-fa=\nmily: Arial, Helvetica, sans-serif; font-size: 12px; color: #666666;"></td>\n  </tr>\n  <tr>\n    <td colspan=3D"2" align=3D"left" valign=3D"top" bgcolor=3D"#FFFFFF" sty=\nle=3D"font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: #0=\n04681; font-weight: bold;"></td>\n  </tr>\n  <tr>\n    <td>&nbsp;</td>\n    <td bgcolor=3D"#FFFFFF"><img src=3D"cid:50px-space1.png@13766889711291"=\n width=3D"50" height=3D"1" /></td>\n    <td  align=3D"left" valign=3D"top" bgcolor=3D"#FFFFFF" style=3D"font-fa=\nmily:  Arial, Helvetica, sans-serif; font-size: 12px; color: #666666;"> <br=\n />\n      Sincerely,\n      </p>\n      <p>%COMPANY_SENT_NAME%<br />\n%CSR_NUM%\n</p>\n      <p style=3D"font-size: 10px;">* A Returned Check Fee may be assessed =\nas shown or the maximum amount permitted by law. Returned Checks, along wit=\nh the returned check fee, may be drafted or electronically presented to the=\n consumer''s bank.</p></td>\n    <td bgcolor=3D"#FFFFFF">&nbsp;</td>\n    <td>&nbsp;</td>\n  </tr>\n  <tr>\n    <td>&nbsp;</td>\n    <td valign=3D"top" bgcolor=3D"#FFFFFF">&nbsp;</td>\n    <td colspan=3D"2" bgcolor=3D"#FFFFFF">&nbsp;</td>\n    <td>&nbsp;</td>\n  </tr>\n  <tr>\n    <td width=3D"10">&nbsp;</td>\n    <td colspan=3D"3" bgcolor=3D"#155fa8" height=3D"3"></td>\n    <td width=3D"10">&nbsp;</td>\n  </tr>\n  <tr>\n    <td>&nbsp;</td>\n    <td colspan=3D"3" align=3D"left" valign=3D"top" style=3D"font-family: A=\nrial, Helvetica, sans-serif; font-size: 12px; color: #999999;">&copy; Asuri=\non 1994-2013. All Rights Reserved</td>\n    <td>&nbsp;</td>\n  </tr>\n  <tr>\n    <td>&nbsp;</td>\n    <td colspan=3D"3" align=3D"left" valign=3D"top" style=3D"font-family: A=\nrial, Helvetica, sans-serif; font-size: 12px; color: #999999;">&nbsp;</td>\n    <td>&nbsp;</td>\n  </tr>\n  <tr>\n    <td>&nbsp;</td>\n    <td colspan=3D"3" align=3D"left" valign=3D"top">&nbsp;</td>\n    <td>&nbsp;</td>\n  </tr>\n</table>\n<br />\n<br />\n<!-- **** Notification No: %CG_NOTIFICATION_NO% **** -->\n\n</body>\n</html>\n------=_Part_286_17364726.1376688971215\ncontent-type: image/png\ncontent-transfer-encoding: base64\nContent-ID: <walmar0.png@13766889711290>\n\niVBORw0KGgoAAAANSUhEUgAAAI0AAAAnCAYAAAAy2cstAAAAAXNSR0IArs4c6QAAAARnQU1BAACx\njwv8YQUAAApvaVRYdFhNTDpjb20uYWRvYmUueG1wAAAAAAA8P3hwYWNrZXQgYmVnaW49Iu+7vyIg\naWQ9Ilc1TTBNcENlaGlIenJlU3pOVGN6a2M5ZCI/Pgo8eDp4bXBtZXRhIHhtbG5zOng9ImFkb2Jl\nOm5zOm1ldGEvIiB4O